export const svgIconNames = Object.keys(svgIcons);

export interface SvgProps extends React.HTMLAttributes<HTMLSpanElement> {
    name: string;
    width?: number | string | null;
    height?: number;
}

const Svg: React.FC<SvgProps> = ({ name, width = 24, height = 24, ...props }) => {
    const icon = svgIcons[name];
    
    if (!icon) {
        console.error(`No icon found for name: ${name}`);
        return null;
    }

    // Render the SVG as JSX by parsing it
    const parser = new DOMParser();
    const svgDoc = parser.parseFromString(icon.svg, 'image/svg+xml');
    const svgElement = svgDoc.documentElement;
    svgElement.setAttribute('fill', 'currentColor');

    return (
        <>
            {React.createElement('svg', {
                ...props,
                ...Array.from(svgElement.attributes).reduce((acc: { [key: string]: string }, attr) => {
                    acc[attr.name] = attr.value;
                    return acc;
                }, {}),
                width: width || svgElement.getAttribute('width') || '24',
                height: height || svgElement.getAttribute('height') || '24',
                
                dangerouslySetInnerHTML: { __html: svgElement.innerHTML },
            })}
        </>
    );
};

export default Svg;
